    DETERMINISTIC
BEGIN
	DECLARE v_stt INT(11) DEFAULT null;
	SELECT stt INTO v_stt FROM stt_tiepnhan WHERE ngay = CURDATE()  AND btn_id = _btn_id limit 1;
	if v_stt is null then
