/* Procedure structure for procedure `p_loadthongtinsoquay` */

/*!50003 DROP PROCEDURE IF EXISTS  `p_loadthongtinsoquay` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_loadthongtinsoquay`(IN `p_madonvi` VARCHAR(100))
SELECT tt.key_cauhinh ,tt.value_cauhinh, tt.ten_quay,tt.sohientai, tt.noidung,MIN(tt.stt) AS stt FROM (
			SELECT aa.key_cauhinh AS key_cauhinh , aa.value_cauhinh AS value_cauhinh, aa.ten_quay AS  ten_quay, IFNULL(tn.sohientai,0) AS sohientai, aa.noidung AS noidung, IFNULL(tn.stt,0) AS stt
			FROM 
			  (SELECT  ch.key_cauhinh AS key_cauhinh ,ch.value AS value_cauhinh, b.ten_quay AS ten_quay ,"Giao dch hin ti s: " AS noidung
			   FROM cau_hinh ch 
				LEFT JOIN  quay b ON ch.id_quay= b.id_quay
			    WHERE ch.id_quay IS NOT NULL
			    ORDER BY ch.id_quay ASC
			    ) aa 
			  LEFT JOIN 
			(			
			SELECT t.btn_id,CASE WHEN t.stt=1 THEN 0 ELSE (MIN(t.stt)-1) END  AS stt  ,(MAX(xx.stt)-1) AS sohientai
			FROM tiepnhan t 
			    LEFT JOIN stt_tiepnhan xx  ON t.btn_id = xx.btn_id
			WHERE  t.trang_thai = 0 AND DATE(t.ngay_tn) =CURDATE()  AND DATE(xx.ngay) = CURDATE() 				
			GROUP BY t.btn_id,t.stt
			ORDER BY t.btn_id ASC
			) tn ON aa.key_cauhinh= tn.btn_id) tt GROUP BY 
            tt.key_cauhinh ,tt.value_cauhinh, tt.ten_quay,tt.sohientai, tt.noidung
            ORDER BY tt.key_cauhinh */$$
DELIMITER ;

/* Procedure structure for procedure `p_load_ct_sanpham` */

