DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `p_load_ct_sanpham`(
	p_idban varchar(500),
	p_madatban varchar(100),
	p_trangthai varchar(100),
	p_madonvi varchar(100)
)
