	select nv.nv_hoten, dv.dv_ten, ct.dbct_id, ct.donvi_ma, ct.db_id, ct.dv_id, ct.dbct_soluong, ct.dbct_dongia, ct.dbct_thanhtien, ct.dbct_ngaylap, date_format(ct.dbct_ngaygiolap,'%d-%m-%Y %H:%i:%s') as dbct_ngaygiolap, ct.dbct_namlap, ct.nv_ma, ct.dbct_trangthai, ct.dbct_ghichu
	from ql_datban db, ql_datban_chitiet ct, ql_dm_dichvu dv, ql_dm_nhanvien nv
	where ct.donvi_ma = p_madonvi AND db.db_id = p_madatban
